// src/components/FolderDetails.js
import React from 'react';

const FolderDetails = ({ folder }) => {
  return (
    <div>
      <h2>Folder Details</h2>
      {folder ? (
        <div>
          <h3>{folder.name}</h3>
          <h4>Subfolders:</h4>
          <ul>
            {folder.sub_folders && folder.sub_folders.length > 0 ? (
              folder.sub_folders.map(subfolder => (
                <li key={subfolder.id}>{subfolder.name}</li>
              ))
            ) : (
              <li>No subfolders</li>
            )}
          </ul>
          <button onClick={() => console.log('Add subfolder')}>Add Subfolder</button>
          <button onClick={() => console.log('Rename folder')}>Rename Folder</button>
          <button onClick={() => console.log('Delete folder')}>Delete Folder</button>
        </div>
      ) : (
        <p>Select a folder to view details</p>
      )}
    </div>
  );
};

export default FolderDetails;
